import React from "react";
import "./home.css";

const Home = () => {
  useEffect(() => {
    useEffect(() => {
      fetch(
        "https://api.themoviedb.org/3/movie/popular?api_key=4e44d9029b1270a757cddc766a1bcb63&language=en-US"
      );
    });
  });
  return <>home</>;
};
export default Home;
